import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import Login from './Login';
import Stats from './Statistiques';

function App() {
  return (
    <Router>
      <Route exact path='/' component={Login} />
      <Route path='/stats' component={Stats} />
    </Router>
  );
}

export default App;
